import React from 'react'
import {Link} from "react-router-dom";
import images from "../images/room-8.jpeg";


export default function Rooms({id, rooms}) {
    console.log({id})

    let defaultImage = `../images/room-${id}.jpeg`;
    return (
        <Link to={`/rooms/${rooms.slug}`} key={id}>
        <section key={id} className="room">
            <div className="" className="img-container">
                <span className="price-top"><h6>${rooms.price}</h6></span>
                <img src="../src//images/room-8.jpeg" style={{width:"100%", display:"block"}}/>
                <div className="room-info">{rooms.name}</div>
                <div className="room-link">Featured</div>
            </div>

        </section>
        </Link>
    )
}
